import React, {Component} from 'react';
import {Modal, Button, Form} from 'react-bootstrap';


class AddRunnerComponent extends Component{
    constructor(props){
        super(props);

        this.state = {
            firstName: 'test',
            lastName: '',
            SIID: 0
        };

        this.handleChange = this.handleChange.bind(this);
    }


    handleChange(event) {
        this.setState({firstName: event.target.value});
    }

    onSubmit() {
        //const test = firstName;

        //console.log(test);
    }


    render(){
        return(


            <Modal
             {...this.props}
             size="med"
             aria-labelledby="contained-modal-title-vcenter"
             centered
             >

             <Modal.Header closeButton>
                <Modal.Title id="contained-modal-title-vcenter">
                    Add a new runner
                 </Modal.Title>
             </Modal.Header>
                <Modal.Body>

                   <Form>
                        <Form.Group controlId="newRunnerFirstName">
                            <Form.Label>First Name</Form.Label>
                            <Form.Control type="text" placeholder="Enter First Name" value={this.state.value} onChange={this.handleChange}/>
                        </Form.Group>
                        <Form.Group controlId="newRunnerLastName">
                            <Form.Label>Last Name</Form.Label>
                            <Form.Control type="text" placeholder="Enter Last Name" />
                        </Form.Group>
                        <Form.Group controlId="newRunnerSIID">
                            <Form.Label>SIID</Form.Label>
                            <Form.Control type="text" placeholder="Enter SIID" />
                        </Form.Group>
                   </Form>

               </Modal.Body>
             <Modal.Footer>

                <Button variant="danger" onClick={this.props.onHide}>Close</Button>
                <Button variant="primary" onClick={this.onSubmit}>Save</Button>

             </Modal.Footer>
           </Modal>
        )
    }
}

export default AddRunnerComponent;
